option::Option::<T>::as_mut.doc:
Converts from `&mut Option<T>` to `Option<&mut T>`.

# Examples

```
let mut x = Some(2);
match x.as_mut() {
    Some(v) => *v = 42,
    None => {},
}
assert_eq!(x, Some(42));
```

