Inserts a value computed from `f` into the option if it is [`None`],
then returns a mutable reference to the contained value.

# Examples

```
let mut x = None;

{
    let y: &mut u32 = x.get_or_insert_with(|| 5);
    assert_eq!(y, &5);

    *y = 7;
}

assert_eq!(x, Some(7));
```
